export default function LogoutPage() {
    const [open, setOpen] = React.useState(true);

    function handleClose(ifStay){
      setOpen(true);
      if(ifStay){
          console.log('stay')
            setOpen(false);
      } else {
        console.log('leave')
        setOpen(false);
      }
    };

    return (
      <div>
        <Dialog
          open={open}
          onClose={handleClose(false)}
          aria-labelledby="alert-dialog-title"
          aria-describedby="alert-dialog-description"
        >
          <DialogTitle id="alert-dialog-title">{"From Wiki Forum"}</DialogTitle>
          <DialogContent>
            <DialogContentText id="alert-dialog-description">
                Do you want to Logout?
            </DialogContentText>
          </DialogContent>
          <DialogActions>
            <Button id='stay' onClick={handleClose(false)} color="primary">
              No
            </Button>
            <Button id="logout" onClick={handleClose(true)} color="primary" autoFocus>
              Yes
            </Button>
          </DialogActions>
        </Dialog>
      </div>
    );
  }
